import React from 'react'
import Header from './Header'

export default function SignUp() {

    //hooks

    //functions

    return (
        <div>
            <Header header="Sign Up"/>
            <input type="number" placeholder='Please Enter Worker ID'/>
            <input type="text" placeholder='Please Enter Full Name'/>
            <p>Forklift License</p>
            <input type="radio" name='forklift' value='yes'/>
            <label for="yes">Yes</label>
            <input type="radio" name='forklift' value='no' />
            <label for="no">No</label>
        </div>
    )
}
